using System;
using System.IO;
using System.IO.Compression;
using System.Reflection;

class Program
{
    static void Main()
    {
        string base64CompressedDll =
            "";

        byte[] compressedBytes = Convert.FromBase64String(base64CompressedDll);
        byte[] dllBytes;

        using (var compressedStream = new MemoryStream(compressedBytes))
        using (var gzipStream = new GZipStream(compressedStream, CompressionMode.Decompress))
        using (var dllStream = new MemoryStream())
        {
            gzipStream.CopyTo(dllStream);
            dllBytes = dllStream.ToArray();
        }

        Assembly loadedAssembly = Assembly.Load(dllBytes);
        Console.WriteLine("DLL loaded successfully: " + loadedAssembly.FullName);

        // var ps = Assembly.Automation.PowerShell.Create().AddScript("$PSVersionTable").Invoke();

        Type psType = loadedAssembly.GetType("System.Management.Automation.PowerShell");

        Console.WriteLine("== Assembly Full Name ==");
        Console.WriteLine(loadedAssembly.FullName);
        Console.WriteLine();

        Console.WriteLine("== Types in Assembly ==");

        foreach (Type type in loadedAssembly.GetTypes())
        {
            Console.WriteLine($"Type: {type.FullName}");

            // List constructors
            foreach (
                var ctor in type.GetConstructors(
                    BindingFlags.Public
                        | BindingFlags.NonPublic
                        | BindingFlags.Instance
                        | BindingFlags.Static
                )
            )
            {
                Console.WriteLine($"  Constructor: {ctor}");
            }

            // List methods
            foreach (
                var method in type.GetMethods(
                    BindingFlags.Public
                        | BindingFlags.NonPublic
                        | BindingFlags.Instance
                        | BindingFlags.Static
                )
            )
            {
                Console.WriteLine(
                    $"  Method: {method.ReturnType.Name} {method.Name}({string.Join(", ", Array.ConvertAll(method.GetParameters(), p => p.ParameterType.Name + " " + p.Name))})"
                );
            }

            // List properties
            foreach (
                var prop in type.GetProperties(
                    BindingFlags.Public
                        | BindingFlags.NonPublic
                        | BindingFlags.Instance
                        | BindingFlags.Static
                )
            )
            {
                Console.WriteLine($"  Property: {prop.PropertyType.Name} {prop.Name}");
            }

            // List fields
            foreach (
                var field in type.GetFields(
                    BindingFlags.Public
                        | BindingFlags.NonPublic
                        | BindingFlags.Instance
                        | BindingFlags.Static
                )
            )
            {
                Console.WriteLine($"  Field: {field.FieldType.Name} {field.Name}");
            }

            Console.WriteLine();
        }

        Console.WriteLine($"type: {psType}");
        return;

        // Call PowerShell.Create()
        MethodInfo createMethod = psType.GetMethod(
            "Create",
            BindingFlags.Public | BindingFlags.Static
        );
        object psInstance = createMethod.Invoke(null, null);

        // Call AddScript("$PSVersionTable")
        MethodInfo addScriptMethod = psType.GetMethod("AddScript", new Type[] { typeof(string) });
        addScriptMethod.Invoke(psInstance, new object[] { "$PSVersionTable" });

        // Call Invoke()
        MethodInfo invokeMethod = psType.GetMethod("Invoke", Type.EmptyTypes);
        var result = invokeMethod.Invoke(psInstance, null);

        // Optional: Print the results (reflection-based loop)
        var enumerable = result as System.Collections.IEnumerable;
        foreach (var item in enumerable)
        {
            Console.WriteLine(item?.ToString());
        }
    }
}
